import { Suspense } from "react";
import App from "./App";
import React from "react";

async function tt() {
  var p = await new Promise((resolve, reject) => {
    setTimeout(() => {
      resolve({ test: "test" });
    }, 3000);
  });
  console.log(p);
  return p;
}
const Test = () => {
  const ttk = tt();
  return <App ttk={ttk.test} />;
};
const Major = () => {
  return (
    <Suspense fallback={<h1>Loading</h1>}>
      <Test />
    </Suspense>
  );
};

export default Major;
